  templateUrl: './recherche-pharmacie.page.html',
  styleUrls: ['./recherche-pharmacie.page.scss'],
})
export class RecherchePharmaciePage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
